import React from "react";

const Nav = () => {
  return (
    <ul className="navs">
      <li>Home</li>
      <li>About us</li>
      <li>Features</li>
      <li>Pricing</li>
      <li>FAQ</li>
      <li>Blog</li>
    </ul>
  );
};

export default Nav;
